import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
      <div className="App">

            <Header />
            <DisplayWeather />
            <Footer />
      </div>  
